// @flow

import React, { Component } from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import {
  IoLogoFacebook,
  IoLogoGithub,
  IoLogoInstagram,
  IoLogoTwitter,
  IoMdMail
} from 'react-icons/io';
export default class Home extends Component {
  render() {
    return (
      <div id="home">
        <Container>
          <Row>
            <IoLogoFacebook/>
            <IoLogoGithub/>
            <IoMdMail/>
            <IoLogoInstagram/>
            <IoLogoTwitter/>
          </Row>
        </Container>
      </div>
    );
  }
}
